import RoomCard from '../components/RoomCard';

const rooms = [
  {
    title: 'Single Room',
    description: 'Perfect for one person, cozy and compact.',
    price: 80,
    image: 'https://source.unsplash.com/featured/?single-room'
  },
  {
    title: 'Double Room',
    description: 'Ideal for two, with a large bed and comfort.',
    price: 120,
    image: 'https://source.unsplash.com/featured/?double-room'
  },
  {
    title: 'Triple Room',
    description: 'Spacious for three people, perfect for small groups.',
    price: 160,
    image: 'https://source.unsplash.com/featured/?triple-room'
  }
];

export default function Rooms() {
  return (
    <div className="p-6 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
      {rooms.map((room, index) => (
        <RoomCard key={index} {...room} />
      ))}
    </div>
  );
}
